css:
.quick-open-file-search-match {
  color: #000000;
  font-weight: bold;
}
.quick-open-result-item {
  cursor: pointer;
}
.omnisearch-modal {
  display: flex;
  flex-direction: column;
}
.omnisearch-search-bar {
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
}
.omnisearch-open-all {
  margin-left: 10px;
  margin-bottom: 10px;
}
.omnisearch-tabs {
  align-items: center;
  display: flex;
  flex-flow: row wrap;
}
.omnisearch-results {
  background: #cccccc;
  min-height: 20em;
  overflow-y: scroll;
  padding: 10px;
  position: relative;
}
.omnisearch-pane {
  flex-grow: 1;
}
.omnisearch-preview {
  align-items: center;
  background-color: rgba(0, 0, 0, 0.1);
  display: flex;
  flex-direction: row;
  justify-content: center;
}
.omnisearch-tabs {
  margin-top: 8px;
}
.omnisearch-tabs > .nuclide-tabs {
  width: 100%;
}
.omnisearch-tabs .key-binding {
  letter-spacing: 0;
  font-size: 0.9em;
  opacity: 0.5;
  transition: opacity 0.2s ease-out;
}
.omnisearch-tabs .key-binding:hover {
  opacity: 1;
}
.omnisearch-symbol-result-filename {
  color: #999999;
  margin-left: 1em;
}
